description:
JAMIE STARR PRESENTS RED: - A HOLIDAY E.P

Jamie Starr 
An aspiring music producer, singer-songwriter, painter, video director... &amp; all around creator &amp; artist..

Since his teen years, where he first had the opportunity to sit down in a room full of instruments. He has gone from headlining shows in post-hardcore bands such has Cove Road, to playing alongside Jazz legends like Chris Vidala.

Around 2008 Jamie Starr decided to focused his music attention towards production &amp; engineering, Looking to cross over from rock music into hip hop. Combining a knowledge of technology and understand of mathematics &amp; music Jamie immediately gained notoriety as a stand out producer. Jamie Starr linked up with Poughkeepsie hip hop powerhouse Cans &amp; Tree City Partners using the producer moniker &quot;boogie Knights&quot;. T.C.P releases such has 2012 RADIO &amp; R.P.S brought Jamie's production sound to the forefront.

As 2012 begins Jamie Starr is looking to establish himself as a solo artist. Looking to truly develop a signature sound of his own.


